import React from "react";
import {
  Search,
  Menu,
  VideoCall,
  Apps,
  Notifications,
  YouTube,
} from "@mui/icons-material";
import { Button, TextField } from "@mui/material";
import "./Header.scss";

function Header() {
  return (
    <div className="header">
      <div className="header__left">
        <div className="header__left__menu">
          <Menu />
        </div>
        <div className="header__left__logo">
          <YouTube />
          <h1>YouTube</h1>
        </div>
      </div>
      <div className="header__center">
        <form>
          <TextField type="text" size="small" sx={{ borderRadius: 0 }}/>
          <Button
            variant="contained"
            disableElevation
            elevation={1}
            color="danger"
            sx={{ p: 1, borderRadius: 0 }}
          >
            <Search />
          </Button>
        </form>
      </div>
    </div>
  );
}

export default Header;
